export default function ExpenseDate(props){
    const day = props.date.gateDate();
    const month = props.date.gateDate();
    const year = props.date.gateDate();
    return(
        <>
            <div>
                <div>{day}</div>
                <div>{month}</div>
                <div>{year}</div>
            </div>
        </>
    )
}
